 "EntityName": "Daniel Giguere",
 "Note": "Daniel Giguere <dgei@videotron.ca>\nPembroke Park Lakes/Emergency Planning/Main Road Blocked on 1/7/2020 From 8:00 am to 12:00 noon.\n\r\n\r\nDear Residents:\r\n\r\nPembroke Park Lakes MHC/Emergency Planning/Main Road Blocked on 1/7/2020\r\n\r\nOn January 7, 2020 from 8:00 am to approximately 12:00 noon,  the main road of the community will be blocked from the entrance to Lot 100, \r\n\r\nWe scheduled another company to move the doublewide mobile home into place.  \r\n\r\nPlease prepare for that day and park your vehicles at the entrance, should you need access out of the community.  Please DO NOT PARK AT THE OFFICE PARKING.\r\n\r\nFor your information, the Broward County Fire Rescue and Emergency Services has been informed.  \r\n\r\nPlease contact Lucy if you should have any questions.  My cellphone #:  305-788-1738\r\n\r\nThank you again for your cooperation.\r\n\r\nLucy\r\n\r\nLucy Suarez/CAM\r\nPembroke Park Lakes\r\nCommunity Manager\r\nT. 305-625-3301\r\nT. 305-621-0258 x 104\r\nF. 305-621-0210\r\nE. l.suarez@trilogy4mgt.com\r\n \r\n\r\n",
