 "EntityName": "Daniel Giguere",
 "Note": "Daniel Giguere <dgei@videotron.ca>\nPembroke Park Lakes/No Street Parking Permitted Overnight\nDear Residents:\r\n\r\nRE:  Pembroke Park Lakes/No Street Parking Permitted Overnight\r\n\r\nWe are getting a lot of calls from residents complaining about street parking overnight.  Please be courteous with your neighbor.   Please see copy of Item 7 of the Community Rules and Regulations.  \r\nNo street parking is permitted overnight.    Any vehicles not complying with this section may be subject to towing, at the owner's expense payable to the towing service and not to the Community Owner.   \r\nLots  2 and 199 are the only residents allowed to street parking.  Lot 1 has assigned parking by entrance.\r\n\r\nWe appreciate your cooperation.\r\n\r\n \r\n7.\tMOTOR VEHICLES, ETC.: A speed limit of fifteen (15) miles per hour applies throughout the Community. Residents are asked to carefully observe all posted signs, both stop and speed signs. ADVISE YOUR GUESTS. Trucks, motorcycles, mini-bikes, motor scooters, mopeds, go-carts, utility trailers, travel trailers, boat trailers, campers or fifth wheels are not allowed in the Community. With the prior written permission of Community Management, peddle/paddleboats, sailboats, rowboats, canoes and kayaks are allowed in the Community, so long as they can be stored in such a way as to not violate other provisions of these Rules and Regulations.  Motorized boats, which do not exceed 5 horse power (H.P.) , are allowed in the Community with the prior written permission of Community Management and with the same storage provisions as required for the non-motorized boats referred to above.  Boats shall not be operated so as to generate a wake of size which will disturb other persons using the lake or which would cause shoreline erosion.  No Personal Water Crafts, commonly known as JetSkis, SeaDoos, Wave Runners, or the like, are ever permitted in the Community. No commercial type vehicles will be permitted to park on the Home Site. One (1) car off-street parking space is provided for most Home Sites, except Home Sites 1 and 2.  No vehicle is ever to be parked, even temporarily, on the lawn portion of the Home Site. Parking of vehicles in neighboring driveways is prohibited. No street parking is permitted overnight. All vehicles, including guests' vehicles, are permitted to park overnight in the parking lot adjacent to the office, if space is available. No unlicensed or inoperative, unsightly or badly damaged vehicle will be permitted to remain in the Community. No major vehicle repairs or oil changing shall be permitted in the driveways of each Home Site. See the Community Manager for area to do repairs and oil changes. Vehicles dripping oil and/or gas must be repaired promptly. The Community Management specifically reserves the right to control and restrict the operation of all delivery transportation or other vehicular traffic within the Community, which Community Management deems to be detrimental to the health, safety and welfare of the Resident(s) and essential to the preservation of the Community grounds and roadways.  Any vehicles not complying with this section may be subject to towing, at the owner=s expense payable to the towing service and not to the Community Owner.\r\n\r\nThank you\r\n\r\nLucy Suarez/CAM\r\nPembroke Park Lakes\r\nCommunity Manager\r\nT.  305-625-3301\r\nT.  305-621-0258 x 104\r\nF.  305-621-0210\r\nE.  l.suarez@trilogy4mgt.com\r\n \r\n\r\n",
