 "EntityName": "Daniel Giguere",
 "Note": "Daniel Giguere <dgei@videotron.ca>\nPembroke Park Lakes/Proof of Mobile Home Ownership\n\r\nDear Residents:\r\n\r\nRE:  Pembroke Park Lakes/Proof of Mobile Home Ownership\r\n\r\nPursuant to Pembroke Park Lakes' Community Rules and Regulations, please provide copy of current registration renewal of your home site, in addition to the a latest contact information in case of emergency.  You may forward the information via email to:  l.suarez@trilogy4mgt.com and also copy w.castellano@trilogy4mgt.com\r\n\r\nPlease see item 2. REGISRATION, below, of the Community Rules and Regulations which state in part that:\r\n\r\n2.\tREGISTRATION: All Manufactured Homes and each occupant thereof must be registered by the Community Owner at the Community Office, listing the name and serial number of the Manufactured Home, the license number then currently in force and effect, the year of the Manufactured Home and the name of the financing institution(s), if any, having claim or lien upon the Manufactured Home, or any improvements or additions thereto, the Home Owners= owner or owners' names and an emergency work telephone number, together with proof of ownership, and each Home Owner MUST execute and complete an application for admission to the Community. Those failing to comply with this procedure shall be evicted from the Community in accordance with Florida Statute 723.061.\r\n\r\nEvery year when the mobile home registration expires on December 31, you must renew it and must provide a copy to the Management Office, to be in compliance.  \r\n\r\nLooking forward to receiving your updated information.\r\n\r\nThank you\r\n\r\nLucy Suarez/CAM\r\nPembroke Park Lakes\r\nCommunity Manager\r\nT.  305-625-3301\r\nT.  305-621-0258 x 104\r\nF.  305-621-0210\r\nE.  l.suarez@trilogy4mgt.com\r\n \r\n",
